GO
    SELECT @ModulTreeID, IsNull(@ClassName, CONVERT(varchar, @ModulTreeID)), NULL, @BaPersonID
ELSE
    SELECT @ModulTreeID, IsNull(TRE.ID + ''/'', '''') + IsNull(@ClassName, CONVERT(varchar, @ModulTreeID)), TRE.ID, @FieldList
    FROM #Tree  TRE
    WHERE ModulTreeID = @ModulTreeID_Parent', NULL, NULL, NULL, NULL, 1, 1)
  SELECT
    ModulTreeID = CASE WHEN dbo.fnUserMayReadFall(@UserID, FLE.FaLeistungID) = 0 THEN 1 ELSE @ModulTreeID END,
    ID          = @ClassName + CONVERT(varchar, FLE.FaLeistungID),
    IconID = CASE
      WHEN dbo.fnUserMayReadFall(@UserID, FLE.FaLeistungID) = 0 THEN 80
      WHEN ARC.FaLeistungID IS NOT NULL  THEN 1003 + 100 * FLE.ModulID  -- Archiviert
      WHEN FLE.DatumBis IS NOT NULL  THEN 1002 + 100 * FLE.ModulID  -- Abgeschlossen
      ELSE 1001 + 100 * FLE.ModulID
    END,
    FLE.FaFallID, FLE.FaLeistungID, @BaPersonID
  FROM FaFall                    FAL
    INNER JOIN FaLeistung        FLE ON FLE.FaFallID = FAL.FaFallID
    LEFT  JOIN FaLeistungArchiv  ARC ON ARC.FaLeistungID = FLE.FaLeistungID AND ARC.CheckOut IS NULL
  WHERE FAL.BaPersonID = @BaPersonID AND FLE.ModulID = @ModulID
  ORDER BY CASE WHEN FLE.DatumBis IS NULL THEN 0 ELSE 1 END, FLE.DatumVon DESC', NULL, NULL, NULL, NULL, 1, 1)
